import { imageListClasses } from '@mui/material'
import React from 'react'

const SingleBox = ({box, index, zombie}) => {
  return (
    <div className={box.position === 11? "border" : ""}
    >
        <p>{box.position}</p>
        {zombie.position === box.position? (
            <img className='boximage' src={zombie.image} alt="" />
        )
        :
        ""
    }
    </div>
  )
}

export default SingleBox
